import React, {useState, useEffect} from 'react'
import TeamMember from "./TeamMember"
import {Grid } from '@mui/material'
import { makeStyles } from '@material-ui/core'
import AusHeadshot from '../images/AusHeadshot.jpg'
const useStyles = makeStyles({
  gridContainer: {
      paddingLeft: '20px',
      paddingRight: '20px',
  }
})

let members = [
  {
    name: 'Austin',
    avatar: "../images/AusHeadshot.jpg",
    bio: "A Little Weird. James is my kid",
    role: "Team Lead",
    major: "CS",
    year: "Senior"
  },
  {
    name: 'Pronklin',
    avatar: "../images/biglogo.png",
    bio: "A Little Weird. James is my kid",
    role: "Team Lead",
    major: "CS",
    year: "Senior"
  }
]

const Team = () => {

  return (
    <div>
      <img src={AusHeadshot}/>
      <br></br>
      <Grid container spacing={2}>
        {members.map((member) => {
          return (
            <Grid item xs={12} sm={6} md={4}>
              <TeamMember member={member}></TeamMember>
            </Grid>
          )
          })}
      </Grid>
    </div>
  )
}

export default Team
